import React from "react";

export default function Sidebar() {
  return (
    <div className="sidebar">
      <img
        src="/images/mask-group-8.png"
        alt="Icon 1"
        className="sidebar-icon"
        style={{ width: "70%" }}
      />
      <img
        src="/images/mask-group-8-2.png"
        alt="Icon 2"
        className="sidebar-icon"
        style={{ width: "70%" }}
      />
      <img
        src="/images/picto-utilisateur-connecte.png"
        alt="Icon 3"
        className="sidebar-icon"
        style={{ width: "70%" }}
      />
      <img
        src="/images/group-3@2x.png"
        alt="Icon 4"
        className="sidebar-icon"
        style={{ width: "70%" }}
      />
    </div>
  );
}
